import { color } from "d3";

function MyFooter() {
    return (
        <footer style={{  textAlign: "center", bottom: "0",
            width: "100%", position: "relative", fontFamily: "Times New Roman, Times, serif",
            fontSize: "1.5vw"
            , backgroundColor:"lightgray",
        }}>
           <p>&copy; Jinheng Hu 2022</p>
        </footer>
    )
}

export default MyFooter;
